import React, {useState, useEffect} from 'react';
import {getUsers} from "../api/api"

const SeeAllUsers= () => {

    const [users, setUsers] = useState([]);

    useEffect(() => {
      getUsers()
      .then((response) =>{
      //console.log(response.data);
      setUsers(response.data)
      })
      .catch(() =>{});
    }, []);
    
    return (
      <div>
        {users}   
     </div>
    );
}

export default SeeAllUsers;
